class ResetPasswordConfirmContainer extends React.PureComponent {
    render () {
        return (<div><ResetPasswordConfirm uid = {this.props.match.params.uid} token={this.props.match.params.token}/></div>)
    }
}

const mapStateToProps = (state) => ({
})

